#include <fuzzer/FuzzedDataProvider.h>

#include <stddef.h>
#include <stdint.h>
#include <string.h>
#include <vector>

#include "GfxFont.h"
#include "GlobalParams.h"
#include "Object.h"
#include "PDFDoc.h"
#include "Stream.h"

extern "C" int LLVMFuzzerTestOneInput(const uint8_t *data, size_t size) {
  FuzzedDataProvider fdp(data, size);

  double hDPI = fdp.ConsumeFloatingPoint<double>();
  double vDPI = fdp.ConsumeFloatingPoint<double>();
  int rotate = fdp.ConsumeIntegral<int>();
  GBool useMediaBox = fdp.ConsumeIntegral<GBool>();
  GBool crop = fdp.ConsumeIntegral<GBool>();
  GBool printing = fdp.ConsumeIntegral<GBool>();
  int sliceX = fdp.ConsumeIntegral<int>();
  int sliceY = fdp.ConsumeIntegral<int>();
  int sliceW = fdp.ConsumeIntegral<int>();
  int sliceH = fdp.ConsumeIntegral<int>();
  std::vector<char> payload = fdp.ConsumeRemainingBytes<char>();

  Object obj;
  obj.initNull();
  MemStream *stream = new MemStream(payload.data(), 0, payload.size(), &obj);

  globalParams = new GlobalParams(NULL);
  globalParams->setupBaseFonts(NULL);

  PDFDoc *doc = NULL;
  try {
    doc = new PDFDoc(stream);
    if (doc->isOk() == gTrue) {
      OutputDev *output_dev = nullptr;
      doc->displayPageSlice(output_dev, 1, hDPI, vDPI, rotate, useMediaBox,
                          crop, printing, sliceX, sliceY, sliceW, sliceH, NULL, NULL);
    }
  } catch (...) {
  }
  delete doc;
  delete globalParams;

  return 0;
}

#include <fuzzer/FuzzedDataProvider.h>

#include <stddef.h>
#include <stdint.h>

#include "GfxState.h"
#include "GlobalParams.h"
#include "OutputDev.h"
#include "PDFDoc.h"

extern "C" int LLVMFuzzerTestOneInput(const uint8_t *data, size_t size) {

  FuzzedDataProvider stream(data, size);

  int page = stream.ConsumeIntegral<int>();
  double hDPI = stream.ConsumeFloatingPointInRange<double>(0.0, 300.0);
  double vDPI = stream.ConsumeFloatingPointInRange<double>(0.0, 300.0);
  int rotate = stream.ConsumeIntegralInRange<int>(-180, 180);
  GBool useMediaBox = stream.ConsumeBool();
  GBool crop = stream.ConsumeBool();
  GBool printing = stream.ConsumeBool();
  int sliceX = stream.ConsumeIntegral<int>();
  int sliceY = stream.ConsumeIntegral<int>();
  int sliceW = stream.ConsumeIntegral<int>();
  int sliceH = stream.ConsumeIntegral<int>();
  std::vector<uint8_t> payload = stream.ConsumeRemainingBytes<uint8_t>();

  Object obj;
  obj.initNull();
  MemStream *str = new MemStream(reinterpret_cast<char*>(payload.data()), 0, payload.size(), &obj);

  PDFDoc *doc = new PDFDoc(str, NULL, NULL, NULL);

  if (doc->isOk()) {
    OutputDev *output_dev = nullptr;
    doc->displayPageSlice(output_dev, page, hDPI, vDPI, rotate, useMediaBox, crop, printing, sliceX, sliceY, sliceW, sliceH, NULL, NULL);
  }

  delete doc;

  return 0;
}
